import React from "react";
import "./UserCardList.css";
import { useNavigate } from "react-router-dom";

const UserCardList = (props) => {
  const navigate = useNavigate();
  const { id, name, username, email, address, phone, website, company } =
    props.value;

  const handleclick = () => {
    console.log(id);
    navigate(``)
  };
  return (
    <>
      <div onClick={handleclick} class="card">
        <header class="card-personal-header">
          <h1 class="card-personal-name">{name}</h1>
          <a href="/" class="card-personal-link">
            {username}
          </a>
          <p class="card-personal-description">{phone}</p>
        </header>
      </div>
    </>
  );
};
export default UserCardList;
